import Button from 'react-bootstrap/Button';
import { useNavigate } from 'react-router-dom';
import { auth, provider} from '../../configs/firebaseConfig';
import '../../css/App.css';

const Login = () => {
  let navigate = useNavigate();


  async function signInWithGoogle() {
    auth
      .signInWithPopup(provider)
      .then((res) => {
      ;
          navigate("/home");
      })
      .catch((error) => {
        alert.error(error.message);
      });

    }
  return (
    <div className="login">
      <div style={{height: "40vw", position: "relative"}}>
        <div style={{position: "absolute", top: "50%", left: "50%", transform: "translate(-50%, -50%)", transform: "translate(-50%, -50%)"}}>
          <div>
            <h1>V√§lkommen till denna enk√§t om Explainable AI!</h1>
            <br></br>
            <p>Du beh√∂ver inte ha n√•gra f√∂rkunskaper inom AI f√∂r att utf√∂ra enk√§ten. Enk√§ten syftar till att utforska vilka likheter och skillnader som kan ses mellan m√§nsklig objektklassificering och Explainable AI-metoder.</p>
            <p> Explainable AI √§r ett omr√•de med fokus p√• att skapa m√§nsklig f√∂rst√•else f√∂r hur en AI-modell fungerar. M√•let √§r att ge insikt i vad som p√•verkade en AI:s beslut och hur det p√•verkades. Detta g√∂rs genom algoritmer som, efter att den AI modellen √§r f√§rdigtr√§nad, 
              retroaktivt f√∂rs√∂ker lista ut hur det fattar sina beslut. M√•nga metoder f√∂r detta finns, men de flesta baseras p√• att man p√• olika s√§tt manipulerar delar av in-datan och observerar hur det f√∂r√§ndrar beslutet.</p>
            <br></br>
            <p>V√•rt m√•l √§r att se likheter och skillnader i vad dessa Explainable AI-algoritmer f√•r fram som de viktigaste aspekterna i objekt-klassificering hos en eller flera AI-modeller och j√§mf√∂ra detta med vad m√§nniskor prioriterar n√§r de presenteras med samma klassificeringsproblem. 
              P√• detta s√§tt kan vi hitta eventuella m√∂nster som kan antyda vilka Explainable AI-metoder som √§r mest lika m√§nskligt resonerande.</p>
            <p> Utifr√•n detta unders√∂ker vi om just dessa metoder ocks√• √§r mer givande f√∂r att √∂ka m√§nniskors f√∂rst√•else f√∂r en tr√§nad AI-modell.</p>
            <br>
            </br>
            <p>Den enda data som sparas √§r dina enk√§tsvar, vilka √§r anonyma.
              <br>
              </br>
              Enk√§ten tar ca <u>X</u> minuter att genomf√∂ra. Stort tack f√∂r din tid!
            </p>
            <br>
            </br>
            <input type="checkbox" id="checkbox" onClick={ () => {
              if(document.getElementById('checkbox').checked) {
                document.getElementById('Login-button').disabled = false;
              }
              else {
                document.getElementById('Login-button').disabled = true;
              }
            }}
            >            
            </input>
            <label>
              <i>
              Jag har tagit del av informationen ovan och samtycker till att delta. Jag √§r	medveten om att mitt deltagande √§r helt frivilligt och att	jag kan avbryta mitt deltagande i studien utan att ange n√•got sk√§l.
              </i>
              </label>
            <br>
            </br>
          </div>
          <Button id="Login-button" style={{ marginTop: "20px"}} disabled variant="outline-secondary" onClick={ () => {
            signInWithGoogle();
          }}
          >
            Logga in med Google
          </Button>
        </div>
      </div>
    </div>
  )
}

export default Login;
